import React from 'react';

function PrintList(props) {
    return (
        <ul>
            props.list.map((elem) => <li>{elem}</li>
        </ul>)
};

class Tile extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            name: 'bulbasaur',
            id: 1,
            type: ['grass', 'poison']
        }

    }

    render() {
        return (
            <div >
                <h1>Pokemon {this.state.name} with ID: {this.state.id}</h1>
                <PrintList list={this.state.type} />
            </div>

        );
    }

}
export default Tile;
